import React from 'react';
import '../App.css';
import {Button} from "antd";
import {HeaderStyled} from "../styledComponent/Header-styled";
import {ButtonStyled} from "../styledComponent/Button-styled";
import {HeaderTextStyled} from "../styledComponent/HeaderText-styled";
import {ButtonFilledStyled} from "../styledComponent/ButtonFilled-styled";

const HeaderComponent: React.FC = () => (
    <HeaderStyled>
        <HeaderTextStyled>
            Microblog:
        </HeaderTextStyled>
        <ButtonFilledStyled>
            <ButtonStyled  type="default">Log In</ButtonStyled>
            <ButtonStyled type="default">Home</ButtonStyled>
        </ButtonFilledStyled>

    </HeaderStyled>
)


export default HeaderComponent;
